import useUsers from "../../store/user";
function User() {
    const { users, execute} =useUsers(state => state);
    const callApi = (e) => {
        execute(`https://jsonplaceholder.typicode.com/users`)
        e.currentTarget.disable = true;
    }

    return(
        <div>
            <button onClick={callApi}> call api </button>
           <div>
               {users.map((user) =>{
                   return <div>{user.name}</div>
               })}
           </div>

        </div>
    )
}

export default  User;
